import React from "react";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  svgHover: {
    fill: theme.palette.foreground.default,
    "&:hover": {
      fill: theme.palette.primary.main,
    },
    transition: "all 0.5s ease",
  },
}));

export const Logo = () => {
  const classes = useStyles();

  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 200 200"
      className={classes.svgHover}
    >
      {/* Letra R */}
      <rect className="cls-1" x="30" y="40" width="10" height="120" rx="5" />
      <path
        className="cls-1"
        d="M60,40 L60,50 C70,40 90,40 90,60 L90,100 C90,120 70,120 60,110 L60,120 L70,120 L70,130 L60,130 L60,140 C70,130 100,130 100,150 L100,200 L90,200 L90,150 C90,130 60,130 60,140 L60,200 L50,200 L50,120 L60,120 L60,110 C50,120 30,120 30,100 L30,60 C30,40 50,40 60,40 Z"
      />

      {/* Espa√ßo centralizado */}
      <rect x="120" y="40" width="20" height="120" fill="transparent" />

      {/* Letra P (centralizada) */}
      <rect className="cls-1" x="130" y="40" width="10" height="120" rx="5" />
      <rect className="cls-1" x="130" y="40" width="60" height="10" rx="5" />
      <rect className="cls-1" x="190" y="40" width="10" height="50" rx="5" />
      <rect className="cls-1" x="130" y="90" width="60" height="10" rx="5" />
    </svg>
  );
};
